import Content from "./Content";
import dummy from "./../db/contents.json";

const BookmarkList = (props) => {
  const contentsList = dummy.contents.map((content) => (
    <Content
      key={content.id}
      id={content.id}
      title={content.title}
      trueIDArr={props.trueIDArr}
      onBookmarkTrue={props.onBookmarkTrue}
      onBookmarkFalse={props.onBookmarkFalse}
    ></Content>
  ));
  return (
    <div>
      <h1>북마크 모아보기</h1>
      <div>
        {/* {dummy.contents
          .filter((content) => {
            return props.trueIDArr.includes(String(content.id));
          })
          .map((trueContent) => (
            <Content
              key={trueContent.id}
              id={trueContent.id}
              title={trueContent.title}
              trueIDArr={props.trueIDArr}
              onBookmarkTrue={props.onBookmarkTrue}
              onBookmarkFalse={props.onBookmarkFalse}
            ></Content>
          ))} */}
        {contentsList}
      </div>
    </div>
  );
};

export default BookmarkList;
